import React, {Fragment} from "react";

const dashboard = ({setAuth}) => {
    return(
        <Fragment>
            <h1>dashboard</h1>
            <button onClick={() => setAuth(false)}> Logout </button>
        </Fragment>
    );
};

export default dashboard;
